import { ReactElement } from "react"


export const statusBody = (cell:any, row:any):any => {
    console.log("cell", cell)
    if(cell === "Completed"){
        return <span className="text-success" >{cell}</span>
    } else {
        return <span className="text-danger" >{cell}</span>
    }
}
